import {makeStyles} from '@material-ui/core/styles'
const useStyles = makeStyles((theme)=>({
   box:{
      marginTop:'10vh',
      overflow:'hidden',
      height:'100vh'
   },
   maincontainer:{
      display:'flex',
      alignItems:'center',
      justifyContent:'center'
   },
   h5:{
      color:'green',
      letterSpacing:'.6rem'
   },
   img:{
      maxWidth:'100%'
   },

}))


export default useStyles
